import logo from '../assets/img/logo.png';
import Bambi from '../assets/img/Brand/Bambi.pngpng';
import Briket from '../assets/img/Brand/Briket.png';
import Carnave from '../assets/img/Brand/Carnave.png';
import Claas from '../assets/img/Brand/Claas.png';
import Mark from '../assets/img/Brand/Mark.png';
import SanIgnacio from '../assets/img/Brand/SanIgnacio.png';
import Soychu from '../assets/img/Brand/Soychu.png';

const Brands = [
  { nombre: "Mark", logo: Mark},
  { nombre: "Briket", logo: Briket},
  { nombre: "Carnave", logo: Carnave},
  { nombre: "Claas", logo: Claas },
  { nombre: "Bambi", logo: Bambi},

];

export default Brands;
